import React, { useState } from "react";
import './Signup.css';
const Signup=()=>{
    const [name,setName]=useState("");
    const [password,setPassword]=useState("");
    const nameChangeHandler=(e)=>{
        setName(e.target.value);
    }
    const passwordChangeHandler=(e)=>{
        setPassword(e.target.value);
    }
    const submitHandler=()=>{
        alert(password);
        console.log("")
    }
    return(
    <div>           
        <div className="container">  
            <h1 className="top-items">Sign Up</h1>
            <h2 className="top-items">Authenticator</h2>
            <form onSubmit={submitHandler}>
                <label for="name" className="startitems">Enter your Name: </label>
                <input onChange={nameChangeHandler} value={name} type="text" id="name"/>
                <label for="passkey" className="startitems">Enter your Password: </label>
                <input onChange={passwordChangeHandler} value={password} type="password" id="passkey"/>
                <button type="submit">Submit</button>
           </form>
        </div>
    
    </div>)
}

export default Signup
